def ossl_rename():
    ossl_err = BipFunction.get_by_name("ERR_PUT_error")
    for call in ossl_err.xCodeTo:
        func = call.func
        if not func.is_ida_name:
            continue
        hxf = func.hxcfunc
        for cn in hxf.get_cnode_filter_type(CNodeExprCall):
            caller = cn.caller.ignore_cast
            if not isinstance(caller, CNodeExprObj):
                continue # indirect call or something
            try:
                if GetElt(caller.value).name == ossl_err.name:
                    lib = cn.ignore_cast.get_arg(0).ignore_cast.value
                    sub = cn.ignore_cast.get_arg(1).ignore_cast.value
                    #print(f'0x{func.ea:08x}: lib {lib}, func {sub}')
                    
                    set_name(func, info[lib][sub])
            except ValueError:
                continue # ignore this
